response.about:
Миссия:
служение высокой идее.
Потенциал, данный природой:
личности созидающие, способные на самопожертвование, на подвиг;
скромные и незаметные, иногда имеют способности к целительству;
трудолюбивые и работоспособные, к середине жизни их ожидают зажиточность, даже богатство.
Черты личности:
индивидуумы, идущие по высокому пути, осознают свои поступки, не строят иллюзий относительно окружающего мира;
способны направлять, учить и вести других людей.
Возможные негативные качества:
люди без стержня запутываются в своих иллюзиях и начинают не щадить ни правого ни виноватого, могут дойти до полного разрушения и цинизма;могут возомнить себя венцом творения - и тогда их путь будет жалок и низок;
могут проявить талант комедийного актера, склонного к лицемерию и лицедейству - всё доводят до абсурда, передразнивают и искажают всё вокруг.
